import React from 'react';
import {Link} from 'react-router-dom';

const NavLinks = () =>{
    return (
        <ul className = 'right'>

        <li><Link to = '/' className = 'btn btn-floating blue lighten-1'> BLOG </Link></li>
        </ul>

    )
}
export default NavLinks;
